import React from 'react';
import ReactRoundedImage from "react-rounded-image";
import MyPhoto from "./ProfilePic.jpeg";

function ProfilePicture() {
    return (
        <div style={{ display: "flex" }}>
        <ReactRoundedImage 
        image={MyPhoto} 
        roundedSize="0" 
        imageWidth="110" 
        imageHeight="110" />
      </div>
    );
}

function HomePage() {
    return (
        <div>
            THIS IS THE HOME PAGE
            <ProfilePicture/>
        </div>
    );
}

export default HomePage;
